import React from "react";
import "./style.css";

function Book(props) {
  return (
    <div className="mainDiv">
       <div className="bookDivContainer">
          <div className="rightSide">

              {this.props.bookData}
          </div>
          <div className="leftSide">
              Left side of book
          </div>
       </div>
    </div>
  );
}

export default Book;
